var MS = MS || {};
jQuery.fn.TabWindow = function (selector, options) {
    return this.each(function () {
        var cont = $(this);
        cont.find('.js-tab').click(function () {
            cont.find('.js-tab').removeClass('tab-active');
            $(this).addClass('tab-active');
            cont.find('.js-tab-content').addClass('hidden');
            var target = $(this).data('tab');
            cont.find('.js-tab-content.' + target).removeClass('hidden');
        });
        // initialize first active tab
        var firstActive = cont.find('.tab-active'); // if no active tab set, take the first one
        if (!firstActive.length) {
            firstActive = cont.find('.js-tab:eq(0)');
        }
        firstActive.click();
    });
};

MS.ModalWindow = function (selector, options) {
    var that = this,
        element = selector,
        container = element.children('.mwindow-cont'),
        fixWidth = container.data('width'),
        fixHeight = container.data('height'),
        opt = $.extend({
            animationInClass: 'anim-fade-in',
            animationOutClass: 'anim-fade-out'
        }, options);

    container.data('mwindow', that);

    that.isOpen = false;

    that.onShow = function () { };

    that.onHide = function () { };

    that.show = function () {
        if (opt.noScroll) {
            $('body').addClass('overflow-hidden');
        }

        if (opt.hideIntercom) {
            $('body').addClass('no-intercom');
        }

        element
            .removeClass('vhidden')
            .removeClass(opt.overlayAnimationInitClass)
            .removeClass(opt.overlayAnimationOutClass)
            .find('.mwindow-inner')
            .scrollTop(0);
        container
            .removeClass('vhidden')
            .removeClass(opt.animationInitClass)
            .removeClass(opt.animationOutClass);

        var innerContent = element.find('.mwindow-inner-c');

        if (innerContent.outerHeight() > element.outerHeight()) {
            $('body').addClass('overflow-hidden');
        }

        if (fixWidth && fixHeight) {
            resizeModalWindow();
        }

        element.addClass(opt.overlayAnimationInClass);
        container.addClass(opt.animationInClass);

        that.isOpen = true;
        that.onShow();
    };

    that.hide = function () {
        if (opt.noScroll) {
            $('body').removeClass('overflow-hidden');
        }

        if (opt.hideIntercom) {
            $('body').removeClass('no-intercom');
        }

        element
            .removeClass(opt.overlayAnimationInClass)
            .addClass('vhidden')
            .addClass(opt.overlayAnimationOutClass);
        //.trigger('mwindow-hide');
        container
            .removeClass(opt.animationInClass)
            .addClass('vhidden')
            .addClass(opt.animationOutClass);

        $('body').removeClass('overflow-hidden');

        that.isOpen = false;
        that.onHide();
    };

    that.resizeWindow = function (width, height) {
        fixWidth = width;
        fixHeight = height;
        resizeModalWindow();
    };

    element.find('.mwindow-hide-o').click(function () {
        that.hide();
    });

    if (fixHeight && fixWidth) {
        $(window).resize(resizeModalWindow);
    }

    element.removeClass('not-initialized');

    function resizeModalWindow() {
        if ($(window).outerWidth() < fixWidth || $(window).outerHeight() < fixHeight) {
            container.css({
                width: '100%',
                height: '100%',
                top: 0,
                left: 0,
                'margin-left': 0,
                'margin-top': 0
            });
            element.addClass('mwindow-fullscreen');
            //alert('ww:' + window.outerWidth + '\n' + 'wh:' + window.outerHeight+ '\n')
        } else {
            container.css({
                width: fixWidth,
                height: fixHeight,
                'margin-left': -fixWidth / 2,
                'margin-top': -fixHeight / 2,
                top: '50%',
                left: '50%'
            });
            element.removeClass('mwindow-fullscreen');
        }
    }
}

function isRetina() {
    var root = (typeof exports === 'undefined' ? window : exports);
    var mediaQuery = '(-webkit-min-device-pixel-ratio: 1.5), (min--moz-device-pixel-ratio: 1.5), (-o-min-device-pixel-ratio: 3/2), (min-resolution: 1.5dppx)';

    if (root.devicePixelRatio > 1) {
        return true;
    }

    if (root.matchMedia && root.matchMedia(mediaQuery).matches) {
        return true;
    }

    return false;
}

function loadImages(retina) {
    $('.retinable').each(function () {
        var src = $(this).data('src');
        if (retina) {
            src = src.replace('.jpg', '_2X.jpg');
            src = src.replace('.png', '_2X.png');
        }
        $(this).attr('src', src);
    });
}

// Init popovers
$(function () {
    var activeInst,
        activeAnchor,
        activeTimer,
        activePopover,
        trackX,
        trackY,
        mouseTracker = $('<div style="position:absolute;width:0;height:0;"></div>'),
        timer = {},
        popInstances = {};

    function showPopover(popover, anchor, track) {
        var inst = popover.mobiscroll('getInst');

        if (inst.isVisible() && activeAnchor && anchor[0] == activeAnchor[0]) {
            return;
        }

        if (activePopover) {
            hidePopover(activePopover);
        }

        activeInst = $.mobiscroll.activeInstance;
        activePopover = popover;
        activeAnchor = anchor.addClass('gen-hover');

        $.mobiscroll.activeInstance = null;

        inst.option('anchor', track ? mouseTracker : anchor);
        inst.show(false, true);
    }

    function hidePopover(popover) {
        popover.mobiscroll('hide');
        activePopover = null;
        if (activeAnchor) {
            activeAnchor.removeClass('gen-hover');
            activeAnchor = null;
        }
        $.mobiscroll.activeInstance = activeInst;
    }

    function getGlobalObject(ref) {
        function index(obj, i) {
            return obj[i];
        }

        return ref.split('.').reduce(index, window);
    }

    $('[data-popover]').each(function () {
        var popId = $(this).attr('data-popover'),
            popover = $('#' + popId),
            mouseTrack = $(this).attr('data-mouse-track') == 'true',
            tapOnly = $(this).attr('data-tap-only') == 'true',
            fullWidth = $(this).attr('data-full-width') == 'true',
            time = +$(this).attr('data-time') || 200,
            anchor = $(this);

        if (!popInstances[popId]) {
            var addonRef = $(this).attr('data-addon-ref'), // mobiscroll addon options object: ex: MS.popoverExtension = { animate: false }; ---> data-addon-ref="MS.popoverExtension"
                addonObject = addonRef ? getGlobalObject(addonRef) : {},
                initObject = $.extend({
                    context: 'body',
                    theme: 'mobiscroll',
                    display: 'bubble',
                    animate: 'pop',
                    cssClass: 'gen-popover-w' + (fullWidth ? ' gen-popover-full' : ''),
                    buttons: [],
                    anchor: anchor,
                    scrollLock: false,
                    focusOnClose: false,
                    onShow: function (event) {
                        var $markup = $(event.target),
                            cont = $.mobiscroll.version.split('.')[0] == 2 ? $('.dw', event) : $('.mbsc-fr-popup', $markup);

                        if (!tapOnly) {
                            cont.on('mouseenter', function () {
                                clearTimeout(timer[popId]);
                            }).on('mouseleave', function () {
                                clearTimeout(timer[popId]);
                                timer[popId] = setTimeout(function () {
                                    hidePopover(popover);
                                }, 200);
                            });
                        }

                        cont.on('touchstart', function (ev) {
                            ev.stopPropagation();
                        });

                        $(document).on('click.mbsc touchstart.mbsc', function () {
                            hidePopover(popover);
                        });
                    },
                    onClosed: function () {
                        $(document).off('click.mbsc touchstart.mbsc');
                    }
                }, addonObject);

            popover.mobiscroll().widget(initObject);

            popInstances[popId] = true;
        }

        popover.mobiscroll('tap', anchor, function (ev) {
            if (mouseTrack) {
                mouseTracker.css({
                    height: anchor.outerHeight(),
                    top: anchor.offset().top,
                    left: $.mobiscroll.util.getCoord(ev, 'X', true)
                }).appendTo('body');
            }

            if (tapOnly && popover.mobiscroll('isVisible')) {
                hidePopover(popover);
            } else {
                showPopover(popover, anchor, mouseTrack);
            }
        });

        if (!tapOnly) {
            anchor.on('mouseenter', function (ev) {
                trackX = ev.pageX;
                trackY = ev.pageY;
                clearTimeout(activeTimer);
                clearTimeout(timer[popId]);
                activeTimer = setTimeout(function () {
                    if (mouseTrack) {
                        mouseTracker.css({
                            height: anchor.outerHeight(),
                            top: anchor.offset().top,
                            left: trackX
                        }).appendTo('body');
                    }
                    showPopover(popover, anchor, mouseTrack);
                }, time);
            }).on('mousemove', function (ev) {
                if (mouseTrack) {
                    trackX = ev.pageX;
                    trackY = ev.pageY;
                }
            }).on('mouseleave', function (ev) {
                clearTimeout(activeTimer);
                clearTimeout(timer[popId]);
                timer[popId] = setTimeout(function () {
                    hidePopover(popover);
                }, 200);
            });
        }

        anchor.on('click touchstart', function (ev) {
            var href = anchor.attr('href');

            ev.stopPropagation();

            if (ev.type == 'click' && href && href != '#') {
                window.location.href = href;
            }
        });
    });
});

Array.prototype.removeValues = function (deleteValue) {
    for (var i = 0; i < this.length; i++) {
        if (this[i] == deleteValue) {
            this.splice(i, 1);
            i--;
        }
    }
    return this;
};
