jQuery.fn.fancyPhonenumber = function () {
    return this.each(function () {
        var parent = $(this),
            input = parent.find('.js-fancy-phone-number-inp'),
            hidden = parent.find('.js-fancy-phone-number-hidden'),
            placeholder_prefix = '+40',
            placeholder_rest = '123 456 789',
            country = '',
            prefix = '',
            rest = '',
            plus = '',
            validate = false,
            ctrlDown = false;
        
        $(document).click(function () {
            parent.find('.fancy-phone-country-drop').removeClass('drop-state-open');
        });
        parent.find('.js-fancy-phone-country-cont').click(function (e) {
            parent.find('.fancy-phone-country-drop').toggleClass('drop-state-open');
            e.stopPropagation();
        });
        parent.on('click', function (e) {
            input.focus();
        });
        parent.find('.fancy-phone-country-drop').on('click', '.country-option', function (e) {
            country = $(this).data('code');

            var quit = false;
            for (var c in countryCodeToRegionCodeMap)
            {
                for (var i = 0; i < countryCodeToRegionCodeMap[c].length; i++)
                {
                    if (country == countryCodeToRegionCodeMap[c][i]) {
                        prefix = c;
                        quit = true;
                        break;
                    }
                }
                if (quit)
                {
                    break;
                }
            }
            parent.find('.fancy-phone-country-drop').toggleClass('drop-state-open');
            updateUI();
            updateHidden();
        });


        input.blur(function () {
            //validate = true;
            hidden.valid();
        });

        input.keydown(function (e) {
            setTimeout(function () { handleNewKey(e.keyCode || e.charCode); });
            e.stopPropagation();
        }).keydown().keyup(function (e) {
            if (e.keyCode == 17)
                ctrlDown = false;
        });
        $(document).keypress(function (e) {
            if (parent.find('.fancy-phone-country-drop').hasClass('drop-state-open'))
            {
                var key = e.keyCode || e.charCode;
                var c = String.fromCharCode(key).toUpperCase();
                var found = parent.find('.country-option[data-name^="' + c + '"]:first');
                if (found.length)
                {
                    var cont = parent.find('.fancy-phone-country-drop-i');
                    var scr = found.offset().top - found.parent().offset().top;
                    cont.scrollTop(scr);
                }
            }
            //alert('key pressed: ' + key + ' ("' + String.fromCharCode(key) + '")');
        });

        if (!input.val()) {
            input.val('1');
            handleNewKey(48);
        }

        function handleNewKey(key) {
            //var key = e.keyCode || e.charCode;
            var updUi = false;
            var result = undefined;

            if ((key == 187 || key == 107) && !prefix.length) { // +
                plus = '+';
            }

            if ((key >= 48 && key <= 57) || (key >= 96 && key <= 105)) { //
                result = findPrefix(prefix + input.val().replace(/\+/g, ''));
                if (prefix != result.prefix ){//|| rest != result.rest) {
                    updUi = true;
                }
            }
            else if (key == 8 || key == 46) { // backspace, del

                if (rest.length == 0) {
                    result = findPrefix(prefix.slice(0, -1));
                    if (prefix.length == 0) {
                        plus = '';
                    }
                    else {
                        plus = '+';
                    }

                    if (prefix != result.prefix || rest != result.rest) {
                        updUi = true;
                    }
                }
                else {
                    result = findPrefix(prefix + input.val().replace(/\+/g, ''));
                }

            }
            else if (key >= 37 && key <= 40) { 
                // arrow keys
            }
            else if (key == 17) // Ctrl key
            {
                ctrlDown = true;
            }
            else if (key == 86 && ctrlDown) { // Ctrl + V
                var rawStr = input.val();
                if (rawStr.match(/^\+?[0-9()\-]+$/g)) {
                    result = findPrefix(prefix + input.val().replace(/\+|[()\-\s]/g, ''));
                    updUi = true;
                }
                else {
                    input.val('');
                }
            }
            else {
                updUi = true;
            }

            if (result !== undefined) {
                prefix = result.prefix;
                rest = result.rest;
                country = result.country;
            }

            if (updUi) {
                updateUI();
            }

            updateHidden();
            if (validate) {
                hidden.valid();
            }
        }
        function updateHidden() {
            if (prefix && !rest) {
                hidden.val('');
            }
            else {
                hidden.val((prefix + rest) ? '+' + prefix + rest : '');
            }
        }
        function updateUI() {
            if (prefix) {
                input.attr('placeholder', placeholder_rest);
            }
            else {
                input.attr('placeholder', 'ex: ' + placeholder_prefix + placeholder_rest);
            }

            var countryContent = parent.find('.js-fancy-phone-country');
            var countryFlag = parent.find('.js-fancy-phone-country-flag-cont');
            if (country && prefix) {
                var flag = $('<div class="flag flag-' + country.toLowerCase() + '"' + ' title="' + getCountryName(country) + '" />' + '</div>');
                countryContent
                    .html('')
                    .append($('<span>+' + prefix + '</span>'));
                countryFlag
                    .html('')
                    .append(flag);
                
                parent.find('.country-option').removeClass('selected-country');
                parent.find('.country-option[data-code="' + country + '"]').addClass('selected-country');

                input.val(rest);
            }
            else {
                var nomatch = $('<div style="width: 18px; height: 12px;"></div>');
                countryContent
                    .html('');
                countryFlag
                    .html('')
                    .append(nomatch);
                input.val(plus + rest);
            }
        }
        /// ---
        /// finds a country by analizing the number prefixes
        /// Returns: an object with the prefix, country and the rest of the number if success, otherwhise the prefix is an empty string
        function findPrefix(whole) {
            for (var i = 1; i <= whole.length; i++)
            {
                var pr = whole.substring(0, i);
                if (countryCodeToRegionCodeMap[pr] !== undefined)
                {
                    return {
                        prefix: pr,
                        country: countryCodeToRegionCodeMap[pr][0],
                        rest: whole.substring(i)
                    };
                }
            }
            return { prefix: '', rest: whole };
        }
        function getCountryName(countryCode) {
            if (isoCountries.hasOwnProperty(countryCode)) {
                return isoCountries[countryCode];
            } else {
                return countryCode;
            }
        }
        
        function countryDropCreate() {
            var countryItemBase = $('<div class="country-option"></div>'),
                countryContainer = parent.find('.js-fancy-phone-country-drop'),
                disabledCountries = ['001', 'AC', 'CW', 'GF', 'NR', 'GP', 'VA', 'MQ', 'MM', 'PW', 'PS', 'NP', 'SS', 'PM', 'SH', 'UZ', 'RE'];
            var arr = [];
            for (var c in countryCodeToRegionCodeMap)
            {
                var countryCode = countryCodeToRegionCodeMap[c][0];
                if (jQuery.inArray(countryCode, disabledCountries) >= 0)
                    continue;

                var countryItem = countryItemBase.clone();
                

                var content = $('<div class="fancy-phone-country-drop-flag flag flag-' + countryCode.toLowerCase()  + '"' + ' title="' + getCountryName(countryCode) + '" />' + getCountryName(countryCode) + '</div>');

                countryItem.attr('data-code', countryCode);
                countryItem.attr('data-name', getCountryName(countryCode));
                countryItem.html(content);
                arr.push({
                    name: getCountryName(countryCode),
                    element: countryItem
                });    
            }

            arr.sort(compare);
            for (var i = 0; i < arr.length; i++) {
                countryContainer.append(arr[i].element);
            }


            function compare(a, b) {
                if (a.name < b.name)
                    return -1;
                if (a.name > b.name)
                    return 1;
                return 0;
            }
        };
        countryDropCreate();
    });
};
$(function () {
    
    $('.js-fancy-phone-number-cont').fancyPhonenumber();
});

