var MS = MS || {};

$(function () {

    $('.demo-dialog-show').click(function () {
        sendDemoWindow.show();
    });

    $('#send-email, #resend-email').click(function () {
        if ($(this).attr('id') == 'resend-email') {
            hideError('email');
        }
        if ($('#send-email-form').valid())
            send('email');
        
    });

    $('#send-sms, #resend-sms').click(function () {
        if ($(this).attr('id') == 'resend-sms') {
            hideError('sms');
        }
        if ($('#send-sms-form').valid())
            send('sms');
    });

    var validator = $("#send-sms-form").data('validator');
    validator.settings.ignore = "";
    $('.country-prefix, .phone').change(updateNumber);
    $('.phone').keyup(updateNumber);

    function updateNumber() {
        var v = $('.phone').val();
        var s = v.length ? $('.country-prefix').val() + v : '';
        var pn = $('.phone-number');
        pn.val(s.replace(/-|[(]|[)]|\s/g, ''));
        if (v.length)
            pn.valid();
    }
    
    function send(form) {
        showBusy(form);
        sendAjax(form);
    }

    function sendAjax(form) {
        var url = form == 'email' ? MS.demoEmailUrl : MS.demoSMSUrl;
        var data = form == 'email' ? $('#send-email-form').serialize() : $('#send-sms-form').serialize();

        var type = form,
            to = form == 'email' ? $('#send-email-form').find('#Email').val() : $('#send-sms-form').find('#Number').val(),
            demo = (form == 'email' ? $('#send-email-form') : $('#send-sms-form')).find('#Url').val();

        MixPanel.track("Demo 2 Device", { "Type": type, "To": to, 'Demo': demo }, function () { });

        $.ajax({
            url: url,
            type: 'post',
            data: data,
            success: function (data) {
                hideBusy(form);
                if (data.success == true) {
                    success(form);
                }
                else {
                    error(form)
                }
            },
            error: function (data) {
                hideBusy(form);
                error(form);
            }
        });
    }

    function success(form) {
        clearForm(form);
        var f = form == 'email' ? '.de' : '.dt';
        $(f + '-form').find('.de-success').removeClass('hidden');
        $('.share-demo-success').removeClass('hidden');
        setTimeout(function () {
            $(f + '-form').find('.de-success').addClass('hidden');
            $('.share-demo-success').addClass('hidden');
            sendDemoWindow.hide();
        }, 5000);
    }
    
    function error(form) {
        var f = form == 'email' ? '.de' : '.dt';
        $(f + '-form').find('.de-error').removeClass('hidden');
        $('.share-demo-error').removeClass('hidden');
        setTimeout(function () {
            $(f + '-form').find('.de-error').addClass('hidden');
            $('.share-demo-error').addClass('hidden');
        }, 5000);
    }

    function hideError(form) {
        var f = form == 'email' ? '.de' : '.dt';
        $(f + '-form').find('.de-error').addClass('hidden');
    }

    function clearForm(form) {
        var f = form == 'email' ? '.de' : '.dt';
        $(f + '-form').find('.de-clear').val('');
    }

    function showBusy(form) {
        var f = form == 'email' ? '.de' : '.dt';
        $(f + '-form').find('.de-busy').removeClass('hidden');
        $('.share-demo-busy-curtain').removeClass('hidden');
    }

    function hideBusy(form) {
        var f = form == 'email' ? '.de' : '.dt';
        $(f + '-form').find('.de-busy').addClass('hidden');
        $('.share-demo-busy-curtain').addClass('hidden');
    }

});
var MS = MS || {};

MS.demopage = MS.demopage || {};

MS.demopage.getCustomTheme = function (theme, themeClass) {
    if (!$.mobiscroll.themes.frame[theme]) {
        var tag = $('<style type="text/less"></style>').appendTo('head'),
            themeData = $('.' + themeClass + '[data-val="' + theme + '"]'),
            colors = themeData.length ? JSON.parse(themeData.attr('data-colors')) : [],
            baseTheme = themeData.attr('data-base-theme'),
            id = '#' + 'less-' + baseTheme,
            css = $(id).text(),
            vars = {},
            c = {};

        if (themeData.length) {
            $.get("//demo." + MS.baseUrl + "/getcustomtheme/" + theme + "/" + MS.demopage.version);

            vars['@theme'] = theme;
            for (var i = 0; i < colors.length; ++i) {
                c[i] = colors[i].split(',');
                vars['@input' + (i + 1)] = 'hsv(' + c[i][0] + ',' + c[i][1] + '%,' + c[i][2] + '%)';
            }

            tag.html(css);
            less.refresh(true, vars);

            $.mobiscroll.themes.frame[theme] = $.mobiscroll.themes.frame['<' + baseTheme + '-base>'];
            $.mobiscroll.themes.listview[theme] = $.mobiscroll.themes.listview['<' + baseTheme + '-base>'];
            $.mobiscroll.themes.menustrip[theme] = $.mobiscroll.themes.menustrip['<' + baseTheme + '-base>'];
            $.mobiscroll.themes.form[theme] = $.mobiscroll.themes.form['<' + baseTheme + '-base>'];
            $.mobiscroll.themes.progress[theme] = $.mobiscroll.themes.progress['<' + baseTheme + '-base>'];
        }
    }
};
var demoApp = angular.module('demoApp', ['mobiscroll-select']);

demoApp.factory('floatingmenu', ['$window', '$rootScope', '$timeout', function ($window, $rootScope, $timeout) {

    function updateDemoShareUrls(demo) {
        var demoTitle = MS.demopage.demos[demo].title,
            demoUrl = 'https://demo.' + MS.baseUrl + '/v' + MS.demopage.version + '/mobile/' + MS.demopage.component + '/' + demo + window.location.hash;

        $('.demo-url-a').attr('href', demoUrl).html(demoTitle);
        $('.demo-url-i').val(demoUrl);
    }

    var popupTimer,
        scrollDebounce,
        hashParams = $.bbq.getState(),
        $body = $('body'),
        $menu = $('#mobilemenu'),
        $menuph = $('#mobilemenuph'),
        $menugr = $('#mobilemenugr'),
        $menuctrl = $('#mobilemenuctrl');

    // Set initial values

    $rootScope.isControlViewVisible = true;

    $rootScope.isSettingsVisited = $.cookie('Mobiscroll_Settings_Visited') == 'true';

    // Methods

    $rootScope.toggleSettings = function () {
        $rootScope.isSettingsVisited = true;
        $rootScope.showActionMenuPopup = false;

        $.cookie('Mobiscroll_Settings_Visited', 'true', { expires: 30, path: '/', domain: 'demo.' + MS.baseUrl });

        if ($rootScope.isSettingsVisible) {
            if (hashParams.modal == 'Settings') {
                $rootScope.preventHashChange = true;
                window.history.back();
            }
        } else {
            $rootScope.preventHashChange = true;
            $.bbq.pushState({
                modal: 'Settings'
            });
        }

        $timeout(function () {
            $rootScope.isSettingsVisible = !$rootScope.isSettingsVisible;
        }, 50);
    };

    $rootScope.toggleControlView = function () {
        $menuctrl.removeClass('mobile-demo-menu-control-view-v');
        $rootScope.isControlViewVisible = !$rootScope.isControlViewVisible;
        if ($rootScope.isControlViewVisible) {
            $menuctrl.show().scrollTop(0);
        }
    };

    $rootScope.navigateToControl = function (ev) {
        var target = $('#' + $(ev.currentTarget).data('hash'))[0];
        $rootScope.toggleControlView();
        $rootScope.menuPHeight = Math.max(0, $menu[0].offsetHeight - 50 + target.offsetTop - $menugr[0].offsetHeight);
        $menuph.height($rootScope.menuPHeight);

        $timeout(function () {
            $body.scrollTop(target.offsetTop);
        });
    };

    $rootScope.showOption = function (opt) {
        if (hashParams.modal) {
            $rootScope.preventHashChange = true;
            window.history.back();
        }

        $body.addClass('demo-modal-content');

        $timeout(function () {
            $rootScope.preventHashChange = true;
            $.bbq.pushState({
                modal: opt
            });

            $timeout(function () {
                var menu = $('.mobile-demo-menu')[0];
                // iOS needs forced repaint
                $timeout(function () {
                    menu.style.display = 'none';
                    menu.offsetHeight;
                    menu.style.display = '';
                }, 200);

                $rootScope['is' + opt + 'Visible'] = true;
                $rootScope.isSettingsVisible = false;
            }, 50);
        }, 50);
    };

    $rootScope.showShare = function (demo) {
        if (!demo) {
            // If share was opened from floating menu,
            // hide floating options
            $rootScope.toggleSettings();
        }
        updateDemoShareUrls(demo || $rootScope.demo);
        sendDemoWindow.show();
        setTimeout(function () {
            $rootScope.preventHashChange = true;
            $.bbq.pushState({
                modal: 'Share'
            });
        }, 50);
    };

    $rootScope.setOption = function (opt, val) {
        $rootScope['is' + opt + 'Visible'] = false;
        $body.removeClass('demo-modal-content');

        $timeout(function () {
            if (hashParams.modal == opt) {
                $rootScope.preventHashChange = true;
                window.history.back();
            }

            $timeout(function () {
                var obj = {};
                obj[opt.toLowerCase()] = val;
                $.bbq.pushState(obj);

                //$timeout(function () {
                //    if (!$rootScope.locationChanged) {
                //        $rootScope.showDemo();
                //    }
                //});
            }, 50);
        }, 300);
    };

    $rootScope.selectOptions = {
        display: 'inline',
        context: 'body',
        theme: 'mobiscroll',
        cssClass: 'mobile-demo-setting',
        layout: 'liquid',
        rows: 100,
        dataText: 'Text',
        dataValue: 'Value',
        showInput: false,
        onValueTap: function (item, inst) {
            var that = this;

            if (item.hasClass('dw-sel')) {
                $rootScope.$apply(function () {
                    $rootScope.setOption($(that).attr('data-target'), item.attr('data-val'));
                });
            }
        },
        onItemTap: function (event, inst) {
            var that = this,
                $item = $(event.target);

            if ($item.hasClass('mbsc-sc-itm-sel')) {
                $rootScope.$apply(function () {
                    $rootScope.setOption($(that).attr('data-target'), $item.attr('data-val'));
                });
            }
        }
    };

    // Listen for hashchange
    $(window).on('hashchange', function () {
        $rootScope.$apply(function () {
            var newHashParams = $.bbq.getState();

            if ($rootScope.preventHashChange) {
                hashParams = $.bbq.getState();
                $timeout(function () {
                    $rootScope.preventHashChange = false;
                });
                return;
            }

            // Hide modals on back button
            if (hashParams.modal && hashParams.modal != newHashParams.modal) {
                if (sendDemoWindow.isOpen) {
                    sendDemoWindow.hide();
                } else {
                    $rootScope['is' + hashParams.modal + 'Visible'] = false;
                    $body.removeClass('demo-modal-content');
                }
            }

            hashParams = $.bbq.getState();
        });
    });

    startTime = new Date();

    $(window).on('scroll', function () {
        $rootScope.$apply(function () {
            $timeout.cancel(scrollDebounce);
            scrollDebounce = $timeout(function () {
                var scrollTop = $(window).scrollTop();
                // Show popup for action button if not yet tapped and content is scrolled
                if (scrollTop > 200 && !$rootScope.isSettingsVisited) {
                    $rootScope.showActionMenuPopup = true;
                }
            }, 200);
        });
    });

    // Show popup for action button after 5 seconds
    popupTimer = $timeout(function () {
        if (!$rootScope.isSettingsVisited) {
            $rootScope.showActionMenuPopup = true;
        }
    }, 5000);

    // Remove state if page is reloaded with it
    $timeout(function () {
        if (hashParams.modal) {
            $rootScope.preventHashChange = true;
            $.bbq.removeState('modal');
        }
    }, 100);

    $(function () {
        sendDemoWindow.onShow = function () {
            //$body.addClass('demo-modal-content');
        };

        // Change hash when Send Demo window is closed
        sendDemoWindow.onHide = function () {
            //$body.removeClass('demo-modal-content');
            setTimeout(function () {
                if (hashParams.modal == 'Share') {
                    $rootScope.preventHashChange = true;
                    window.history.back();
                }
            }, 50);
        };

        // Init floating action button
        window.FastClick.attach($('#fastclick')[0]);

        $('.mbsc-float-menu').on('touchmove', function (ev) {
            ev.preventDefault();
        });
    });

    return {};
}]);
